import React from 'react';
import CssBaseline from '@material-ui/core/CssBaseline';
import Typography from '@material-ui/core/Typography';

import Header from './commoncomponent/header';
import Content from './homecomponent/content';
import ContactUs from './homecomponent/contactus';
import Footer from './commoncomponent/footer';

function userControl(){
  return (
    <React.Fragment>
      <Content />
      <ContactUs />
      <Footer />
    </React.Fragment>
  )
}
export default function FixedContainer() {

  const loggedUser = JSON.parse(localStorage.getItem('userLoginData'));
  let setLogin;
  if(loggedUser.email == 'admin@gmail.com')
    setLogin = false;
  else
    setLogin = true;

  return (
    <React.Fragment>
      <CssBaseline />
      <Typography component="div" style={{ backgroundColor: '#ffffff', height: '100%' }} >
        <Header />
        {setLogin? <p>test</p>: <userControl></userControl>}

      </Typography>
    </React.Fragment>
  );
}
